import React, { useState } from 'react';
import App from './App'; // Course management
import StudentRegistration from './StudentRegistration';

function Main() {
  const [page, setPage] = useState('home');

  return (
    <div>
      <nav className="navbar navbar-dark bg-dark px-3">
        <button className="btn btn-outline-light me-2" onClick={() => setPage('home')}>
          Course Management
        </button>
        <button className="btn btn-outline-light" onClick={() => setPage('student')}>
          Student Registration
        </button>
      </nav>

      {page === 'home' && <App />}
      {page === 'student' && <StudentRegistration />}
    </div>
  );
}

export default Main;
